import '../Products/Products.scss'
import Product_table from '../../Components/Product_table';
const drawerWidth = 250;
export default function Products() {
    const [product, setProduct] = useState([])
    const [product_details, setProduct_details] = useState([])


    useEffect(() => {
        setProduct(["#", "Product_name", "Product_details", "Amount", "Auction", "Stock", "Category", "Action"])

        setProduct_details([{
            id: 1,
            Product_img:'',
            User_name: 'Amit kumar yadav',
            Transction_Id: 'dfg542314tfd',
            Date: '02/01/2002',
            Product_name: 'shirt',
            Amount: 500,
            Status: 'Success'

        }, {
            id: 2,
            User_name: 'Atul yadav',
            Transction_Id: 'dfg542314tfdgf',
            Date: '02/01/2021',
            Product_name: 't-shirt',
            Amount: 1000,
            Status: 'Pending'

        }, {
            id: 3,
            User_name: 'Harsh kumar',
            Transction_Id: 'dfg5423',
            Date: '02/01/2003',
            Product_name: 'jeans',
            Amount: 500,
            Status: 'Cancle'

        }, {
            id: 4,
            User_name: 'Amit kumar yadav',
            Transction_Id: 'dfg542314tfd',
            Date: '02/01/2002',
            Product_name: 'shirt',
            Amount: 200,
            Status: 'Success'

        }, {
            id: 5,
            User_name: 'Nafisul Hasan',
            Transction_Id: 'dfg5423145tfd',
            Date: '02/01/2004',
            Product_name: 'shirt',
            Amount: 500,
            Status: 'Success'

        }])
    }, [])
    return (
        <>
            <Box sx={{ display: 'flex', flexDirection: 'column' }}>
