                <Toolbar sx={{
                    width: { md: `calc(100% - ${drawerWidth}px)` },
                    ml: { md: `${drawerWidth}px` }
                }} />
                <Box sx={{
                    width: { md: `calc(100% - ${drawerWidth}px)` },
                    ml: { md: `${drawerWidth}px` }
                }} >


                    <div className='Products_container'>
                        <div className='my-3'>
                            <h3>Product_table</h3>
                            <Product_table Thead={product} Tbody={product_details} />
                        </div>
                    </div>



                </Box>


            </Box>
        </>
    )
}
